import Link from 'next/link';

const linkStyle = {
  marginRight: 15,
  backgroundColor: 'black',
  height: '100vh',
};

const Header = () => (
  <div>
    <Link href='/'>
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href='/about'>
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
